import React from 'react';
import Inventory from './components/Inventory/Inventory';
import ListSale from './components/ListSale/ListSale'; 

function App() {
  return (
    <div className="App">
      <Inventory />

      <RegisterSale onSale={() => console.log('Venta registrada y lista actualizada')} />
      <ListSale />
    </div>
  );
}

export default App;
